import React from 'react'
import '../styles/style.css'

function Food(props) {
  
    const style = {
        top: `${props.food[0]}%`,
        left: `${props.food[1]}%`
    }
  
    return (
    <div className="food" style={style}>
    </div>
  )
}

export default Food
